- proto: GasPressurePump
  entities:
  - uid: 954
    components:
    - type: Transform
      rot: -1.5707963267948966 rad
      pos: 11.5,-17.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
    - type: AtmosPipeColor
      color: '#0055CCFF'
  - uid: 1872
    components:
    - type: MetaData
      desc: Extracts nitrogen from the nitrogen storage tank to be mixed into breathable air. Make sure this pump is off whenever you open and close the storage tank door, otherwise you will pull gas from the ship and contaminate the main air storage tank.
      name: nitrogen gas extraction pump
    - type: Transform
      rot: 3.141592653589793 rad
      pos: 1.5,-33.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
    - type: AtmosPipeColor
      color: '#947507FF'
  - uid: 2005
    components:
    - type: MetaData
      desc: Extracts cold gas from the air storage tank and pumps it into the air heater to be warmed up for distro. Make sure that before you turn this on, the distro air pump is turned off so that no cold gas can escape into the ship. Once the air heater is active and the cold air pump is turned on, you can check the gas temperature differences using the gas analyzer.
      name: cold air pump
    - type: Transform
      rot: 1.5707963267948966 rad
      pos: 0.5,-30.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
    - type: AtmosPipeColor
      color: '#03FCD3FF'
  - uid: 2212
    components:
    - type: MetaData
      desc: Pumps warm air from the air heater into the ships air network, at a steady pressure. Make sure that before you turn this on, you have measured the temperature of the cold air pump with the gas analyzer.
      name: distro air pump
    - type: Transform
      rot: 3.141592653589793 rad
      pos: 3.5,-30.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
    - type: AtmosPipeColor
      color: '#0055CCFF'
  - uid: 2694
    components:
    - type: MetaData
      desc: Extracts the gas from the shower room into the waste pipe network. Water vapor is then filtered out and returned to the water tank inside of the janitors closet. Make sure that distro is active before you turn this on or you will suffocate anyone who enters the room.
      name: shower off pump
    - type: Transform
      rot: 3.141592653589793 rad
      pos: 6.5,-32.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
- proto: GasThermoMachineFreezer
  entities:
  - uid: 440
    components:
    - type: Transform
      pos: 8.5,-16.5
      parent: 1
    - type: AtmosDevice
      joinedGrid: 1
  - uid: 2124
    components:
    - type: MetaData
      desc: Cools down the air from the oxygen/nitrogen gas mixer to allow for a more compact gas storage. Ensure that the air heater is active and that youve checked the pipe temperatures with a gas analyzer before you turn on the pump below this.
      name: air cooler
    - type: Transform
